script: |
  super -f text -I q5326.spq | sort > q5326.out

inputs:
  - name: q5326.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - 9 / + CAST ( NULL AS INTEGER ) IN ( 57 * - 65 - col1, - col0, - 71 * + 30 );
  - name: tab1

outputs:
  - name: q5326.out
    data: |
